import './App.css';
import Forecast from ".Forecast/Forecast/Forecast";

function App() {
 return (
   <div className="App">
     <header className="App-header">
       <h1>React Weather App</h1>
     </header>
     <main>
       <Forecast />
     </main>
     <footer>
       Page created by yournamehere
     </footer>
   </div>
 );
}

export default App;
